res_mers = []

def clump_finder(text, k, l, t):
    for i in range(0, len(text)):
        k_mers = {}
        for j in range(i, i + l):
            if j + k < len(text):
                k_mer = text[j:(j+k)]

                if k_mer in k_mers:
                    k_mers[k_mer] += 1
                else:
                    k_mers[k_mer] = 1
            else:
                break

        for item in k_mers:
            if k_mers[item] >= t:
                res_mers.append(item)

    return (set(res_mers))

print(clump_finder("", 10, 596, 20))
